function animate(){

		delay= ($(this).attr('cn')*200)+1000;
		$(this).delay(delay).animate({'stroke-width':"10px"},200).animate({'stroke-width':"5px"},70);
	});
	lines = $('line[n]');
	$.each(lines,function(){
		delay= ($(this).attr('n')*200)+800;
